- input: "TEXT\x1CC00025254\x1CX0\x1C\x1CF3XN\x1CSchedule B line 21b for individuals
    that are paid 100% Federal but not currently involved in Federal Election Activity.
    \ Schedule H4 line 21a for individuals who spend more the 0% but less than 25%
    in a given month on any Federal activity.  Schedule B line 30b for individuals
    who spend any time on Federal  Election Activity.  All expenses related to the
    individuals are split amongst these three groups. The Committee discloses payments
    for payroll, taxes and health-dental-life insurance accordning to the three types
    of activity refrenced above.    The State Party was required to pay up front with
    cashier?s checks for the election night party.  One check was a deposit of $15,000.00.
    \  It became necessary for us to draw on our state account as this is the only
    account with a verified balance large enough to cover the cashiers check.  Our
    bank accounts were not able to be verified because the company that does the processing
    work for our bank (Drake Bank) was located in New Jersey and shut down because
    of Hurricane Sandy.  The processing center was unable to provide any information
    for several days and when they were up and functioning they had to re-process
    all the transactions that had been lost from their initial shut down.  The party
    waited as long as possible for correct balances to appear in our bank accounts.
    \ Unfortunately it was not done by the time we had to pay for the Election Night
    party.  The deposit for $15,000.00 has now been processed by the hotel and all
    but $2190.50 has been returned to the party. The Federal share of $2190.50 is
    $788.58 and appears on this report, Schedule B, Line 22,  page 31.     The party
    paid for all volunteer materials on this report with its own funds.  No funds
    from National Party Transfers were used in association with these activities.
    \ \n"
